import React from "react";
import Functions from "../components/function/function";
import Info from "../components/info/Information";
import Navbar from "../components/navbar/navbar";
import BackToTop from "../components/TotopButton";
import './App.css';
// import { Container, Box } from "@mui/material";

function Home() {

  return (
    <div className="Home">

      <Navbar />
       <Functions />
      <BackToTop /> 
      <Info />
    </div>
  );
}

export default Home;
